import React from "react";

const AllLivePlayers = ({ player }) => {
  return (
    <div>
      <form>
        <td>{player.data.name}</td>
        <td>
          <select name="category" value={player.data.category}>
            <option value="live">live</option>
            <option value="silent">silent</option>
          </select>{" "}
        </td>
        <td>
          <select name="display" value={player.data.display}>
            <option value="true">true</option>
            <option value="false">false</option>
          </select>{" "}
        </td>
        <td>
          <select name="status" value={player.data.status}>
            <option value="open">open</option>
            <option value="close">close</option>
          </select>{" "}
        </td>
      </form>
    </div>
  );
};

export default AllLivePlayers;
